import React from "react";
import Nav from "../components/navbar";

export default function Index() {
  return (
    <div id="wrapper">
      <Nav />
      <div id="banner">
        <img src="/engine.jpg" />
      </div>

      <h1>About the Company</h1>
      <style jsx global>{`
        body {
          margin: 0px;
        }
        #wrapper {
          float: left;
          width: 100%;
          background: white;
          margin-top: 0;
          padding: 0;
        }
        #banner {
          float: left;
          width: 100%;
          height: 350px;
          overflow: hidden;
          position: relative;
        }
        h1 {
          float: left;
        }
        img {
          float: left;
          width: 100%;
          height: 100%;
        }
        `}</style>
    </div>
  );
}
